{"title":"Nomad exec times tasks over input size","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v2.json
  data: {
    url: {
      index: logstash-*
      body: {
        size: 10000
        query: {
          bool: {
            must: [
              "%dashboard_context-must_clause%"
              {
                range: {
                  @timestamp: {
                    "%timefilter%": true
                  }
                }
              }
              {
                bool: {
                  should: [
                    {
                      match: {
                        event.keyword: normalizer executed
                      }
                    },
                    {
                      match: {
                        event.keyword: parser executed
                      }
                    }
                  ]
                }
              }
            ]
            must_not: [
              "%dashboard_context-must_not_clause%"
            ]
          }
        }
        _source: [
          "nomad.processing.input_size", 
          "nomad.processing.exec_time",
          "nomad.processing.normalizer",
          "nomad.processing.parser",
          "event"]
      }
    }
    format: {property: "hits.hits"}
  }
  transform: [
    {
      calculate: "datum._source['nomad.processing.input_size']"
      as: "input_size"
    },
    {
      calculate: "datum._source['nomad.processing.exec_time']"
      as: "exec_time"
    },
    {
      calculate: "datum._source['event'] + ': ' + (datum._source['nomad.processing.normalizer'] || datum._source['nomad.processing.parser'] || 'none')"
      as: "normalizer"
    }
  ]
  mark: point
  encoding: {
    x: {
      field: input_size
      type: quantitative
      scale: {
        type: log
      }
      axis: { 
        title: Input size in bytes 
        format: s
      }
    }
    y: {
      field: exec_time
      type: quantitative
      scale: {
        type: log
      }
      axis: { 
        title: "Exec time in s" 
        format: s
      }
    }
    color: {
      field: normalizer
      type: nominal
      legend: { title: 'Normalizer' }
    }
    shape: {
      field: normalizer
      type: nominal
    }
  }
}
"},"aggs":[]}
